import React, { useEffect } from "react";

function Nav() {
  // Initialize the SideNav when the React Component mounts
  useEffect(() => {
    let sidenav = document.querySelector("#slide-out");
    // M.Sidenav.init(sidenav, {});
  }, []);

  return (
    <>
      <nav id="nav">
        <div className="container">
          <div className="row nav-wrapper">
            <ul className="nav-wrapper__menu">
              <li className="nav-wrapper__item--logo">
                <a href="#hero">Img</a>
              </li>
              <li className="nav-wrapper__item">
                <a href="#about">About</a>
              </li>
              <li className="nav-wrapper__item">
                <a href="#projects">Work</a>
              </li>
              <li className="nav-wrapper__item">
                <a href="#contact">Contact</a>
              </li>
              <li className="nav-wrapper__toggle">burger</li>
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
}
export default Nav;
